import React from 'react';

const FlagLv = props => (
  <svg viewBox="0 0 1200 600" {...props}>
    <path fill="#9E3039" d="M0 0h1200v600H0" />
    <path fill="#FFF" d="M0 240h1200v120H0" />
  </svg>
);

export default FlagLv;
